import React, { Component } from 'react'
import Container from 'react-bootstrap/Container'
import Button from 'react-bootstrap/Button'
import {
    withRouter
  } from "react-router-dom"

class UnitsComponent extends Component {

    constructor(props) {
        super(props)

        this.state = {
            url: this.props.url
        }

        this.handleChange = this.handleChange.bind(this)
    }

    handleChange(event) {
        this.setState(
            {[event.target.name]: event.target.value}
        )
    }

    addUnitClicked() {
        // this.props.history.push(`/projects`)
        console.log("url is" + this.state.url)
        this.props.history.push({
            pathname: this.state.url + '/unit/new',
            state: { unitId: 1},
        })
    }

    render() {
        return (
            <Container className="mt-3">
                <h2>{this.props.match.params.id}</h2>
                <h2>UNITS</h2>
                <Button onClick={this.addUnitClicked.bind(this)}>add new unit??</Button>
            </Container>
        )
    }
}

export default withRouter(UnitsComponent)
